import React from 'react';
const Productshowcase = () => {
    return (
        <div className='product-showcase'>
            <div className="showcase-wrapper">
                <img src="https://web-images.credcdn.in/_next/assets/images/home-page/phone/left-2.png" className='showcase-ui ' alt="Mobile" />
                <img src="https://web-images.credcdn.in/_next/assets/images/home-page/phone/left-1.png" className='showcase-ui ' alt="Mobile" />
                <img src="https://web-images.credcdn.in/_next/assets/images/home-page/phone/center.png" className='showcase-ui ' alt="Mobile" />
                <img src="https://web-images.credcdn.in/_next/assets/images/home-page/phone/right-2.png" className='showcase-ui ' alt="Mobile" />
                <img src="https://web-images.credcdn.in/_next/assets/images/home-page/phone/right-1.png" className='showcase-ui ' alt="Mobile" />
            </div>
        </div>
    )
}

export default Productshowcase;
